import { NavLink } from 'react-router-dom';
import './style.css';

const Navbar = () => {
 return (
  <nav className="nav">
   <div className="container">
    <div className="nav-row">
     <NavLink to="/" className="logo">
      <strong>Freelancer</strong> portfolio
     </NavLink>

    </div>
   </div>
  </nav>
 );
};

export default Navbar;
